    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE col2 * + col0 + col1 NOT BETWEEN 76 * 31 + - CAST ( + col1 AS INTEGER ) AND - col0;
  - name: tab0

outputs:
  - name: q9773.out
    data: |
      15	81	47
      87	21	10
      97	1	99
